Populate subdocument array field with Mongoose<p>I know this question has been asked before, but after hours of research I have tried several ways to solve my problem without success.</p>
<h2>Schema</h2>
<pre><code>    const ValuationsSchema = new Schema(
      {
        value: { type: Number, required: true, min: 0, max: 5 },
        author: {
          type: Schema.Types.ObjectId,
          refPath: &quot;fromModel&quot;,
          required: true,
        },
        fromModel: {
          type: String,
          required: true,
          enum: [&quot;usertype1&quot;, &quot;usertype2&quot;, &quot;usertype3&quot;],
          trim: true,
        },
      },
      {
        timestamps: true,
      }
    );

    const UserSchema = new Schema(
      {
        name: { type: String, required: true, trim: true },
        valuations: [ValuationsSchema],
      },
      {
        timestamps: true,
      }
    );
</code></pre>
<h2>What am I trying to do</h2>
<p>I am trying to populate the <code>author</code> field of <code>ValuationsSchema</code>, in the <code>valuations</code> array of a <code>user</code>.</p>
<h2>Sample data</h2>
<p>Result expected</p>
<pre><code>{
  _id: 5f1ef9f6039fea10c437939c,
  name: 'Jose Maria',
  createdAt: 2020-07-27T15:59:50.529Z,
  updatedAt: 2020-08-01T15:34:47.414Z,
  valuations: [
    {
      _id: 5f258b973c0ac544869c0434,
      value: 5,
      author: Object,
      fromModel: 'particular',
      createdAt: 2020-08-01T15:34:47.414Z,
      updatedAt: 2020-08-01T15:34:47.414Z
    }
  ]
}
</code></pre>
<p>Result gotten</p>
<pre><code>{
  _id: 5f1ef9f6039fea10c437939c,
  name: 'Jose Maria',
  createdAt: 2020-07-27T15:59:50.529Z,
  updatedAt: 2020-08-01T15:34:47.414Z,
  valuations: [
    {
      _id: 5f258b973c0ac544869c0434,
      value: 5,
      author: 5f1edaa83ce7cf44a2bd8a9a,
      fromModel: 'particular',
      createdAt: 2020-08-01T15:34:47.414Z,
      updatedAt: 2020-08-01T15:34:47.414Z
    }
  ]
}
</code></pre>
<hr />
<h2>Already tried solutions</h2>
<p>At the moment I manually populated the field, but as it is a good practice, I am trying to use the API when possible.</p>
<p>As far as I am concerned executing this should get the job done, but it doesn't.</p>
<pre><code>    await user.populate(&quot;valuations.author&quot;).execPopulate();
</code></pre>
<p>Also tried this without luck:</p>
<pre><code>    await user.populate({
                        path: &quot;valuations&quot;,
                        populate: {
                          path: &quot;author&quot;,
                        },
                      }).execPopulate();
</code></pre>
<p>Tried the <a href="https://www.npmjs.com/package/mongoose-deep-populate" rel="nofollow noreferrer">deepPopulate package</a> too, but yet same result.</p>

