    name:{
        type: String,
        require: [true,'Name field is required']
    },
    rank:{
        type: String,
        require: [true,'This field is required']
    },
    available:{
        type: Boolean,
        default: false,
        require: [true,'This field is required']
    }
    //add in geo loction
