Combine aggregation pipelines with update operators<p>I would like to aggregate different <code>measurements</code> into a single document acting as a bucket. I receive individual measurements in this format:</p>
<pre><code>[
  {
    &quot;datetime&quot;: &quot;2020-08-03T08:00:01.648475Z&quot;,
    &quot;celsius&quot;: 20.7,
    &quot;humidity&quot;: 57
  },
  {
    &quot;datetime&quot;: &quot;2020-08-03T08:05:07.756834Z&quot;,
    &quot;celsius&quot;: 18.9,
    &quot;humidity&quot;: 58
  }
]
</code></pre>
<p>The aggregated bucket should look like this:</p>
<pre><code>{
  &quot;_id&quot;: &quot;2020-08-03&quot;,
  &quot;celsiusHigh&quot;: 20.7,
  &quot;celsiusLow&quot;: 18.9,
  &quot;firstMeasurementAt&quot;: &quot;2020-08-03T08:00:01.648475Z&quot;,
  &quot;lastMeasurementAt&quot;: &quot;2020-08-03T08:05:07.756834Z&quot;,
  &quot;humidityHigh&quot;: 58,
  &quot;humidityLow&quot;: 57,
  &quot;measurements&quot;: [
    {
      &quot;datetime&quot;: &quot;2020-08-03T08:00:01.648475Z&quot;,
      &quot;celsius&quot;: 20.7,
      &quot;humidity&quot;: 57
    },
    {
      &quot;datetime&quot;: &quot;2020-08-03T08:05:07.756834Z&quot;,
      &quot;celsius&quot;: 18.9,
      &quot;humidity&quot;: 58
    }
  ]
}
</code></pre>
<p>Since MongoDB 4.2 I can make use of <a href="https://docs.mongodb.com/manual/tutorial/update-documents-with-aggregation-pipeline/" rel="nofollow noreferrer">Aggregation Pipelines</a>. However, these pipelines support only the stages <code>$addFields</code>, <code>$set</code>, <code>$project</code>, <code>$unset</code>, <code>$replaceRoot</code>, and <code>$replaceWith</code>. I would like to use other update operators, such as <code>$setOnInsert</code> (to set fields only once - upon insertion), <code>$currentDate</code> (to set e.g. <code>lastUpdatedAt</code>), or <code>$addToSet</code> to set some of the bucket's fields. Without <code>$addToSet</code> the operation looks quite verbose:</p>
<pre><code>{ $set : { &quot;measurements&quot;: { $setUnion : [ { $ifNull: [ &quot;$measurements&quot;, [] ] } , [ { &quot;datetime&quot;: &quot;2020-08-03T08:05:07.756834Z&quot;, &quot;celsius&quot;: 18.9, &quot;humidity&quot;: 58 } ] ] } } }
</code></pre>
<p>Is there a possibility to combine aggregation pipelines with update operators?</p>

